import React, { useEffect, useState } from "react";
import axios from "axios";
import "tailwindcss/tailwind.css";

const Account = () => {
  const [companies, setCompanies] = useState([]);
  const [newCode, setNewCode] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:3000/company")
      .then((response) => {
        setCompanies(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);
  const refreshPage = () => {
    window.location.reload();
  };
  const handleClick = async (id_company) => {
    try {
      const response = await axios.delete(
        `http://localhost:3000/company/${id_company}`
      );
      console.log("deleted");
      refreshPage();
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  };

  const updateHandleClick = async (id_company) => {
    try {
      const response = await axios.put(
        `http://localhost:3000/update-company/${id_company}`,
        { code: newCode }
      );
      console.log("updated");
      refreshPage();
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  };
  
  return (
    <table className="min-w-full divide-y divide-gray-200">
      <thead className="bg-gray-50">
        <tr>
          <th
            scope="col"
            className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
          >
            Email
          </th>
          <th
            scope="col"
            className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
          >
            Téléphone
          </th>
          <th
            scope="col"
            className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
          >
            Nom de l'entreprise
          </th>
          <th
            scope="col"
            className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
          >
            Nom de formation
          </th>
          <th
            scope="col"
            className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
          >
            Message
          </th>
          <th
            scope="col"
            className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
          >
            Code
          </th>
          <th
            scope="col"
            className="px-6 py-3 text-center text-xs font-medium text-gray-500 uppercase tracking-wider"
          >
            Actions
          </th>
        </tr>
      </thead>
      <tbody className="bg-white divide-y divide-gray-200">
        {companies.map((company) => (
          <tr key={company.id}>
            <td className="px-6 py-4 whitespace-nowrap">
              <div className="text-sm text-gray-900">{company.email}</div>
            </td>
            <td className="px-6 py-4 whitespace-nowrap">
              <div className="text-sm text-gray-900">{company.phone}</div>
            </td>
            <td className="px-6 py-4 whitespace-nowrap">
              <div className="text-sm text-gray-900">{company.companyname}</div>
            </td>
            <td className="px-6 py-4 whitespace-nowrap">
              <div className="text-sm text-gray-900">
                {company.trainingcourse}
              </div>
            </td>
            <td className="px-6 py-4 whitespace-nowrap">
              <div className="text-sm text-gray-900">{company.message}</div>
            </td>
            <td className="px-6 py-4 whitespace-nowrap">
              <input
                type="text"
                name="code"
                id="code"
                className="shadow-sm focus:ring-green-500 focus:border-green-500 block w-full sm:text-sm border-gray-300 rounded-md placeholder-gray-400 py-2 px-3 leading-tight focus:outline-none focus:shadow-outline-gray"
                placeholder="Code"
                value={newCode}
                onChange={(event) => setNewCode(event.target.value)}
              />
            </td>

            <td className="px-6 py-4 whitespace-nowrap">
              <div className="flex items-center justify-center">
                <button className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
                  Confirmer
                </button>
                <button
                  className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded ml-2"
                  onClick={() => handleClick(company.id_company)}
                >
                  Refuser
                </button>
              </div>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Account;
